import Nav from 'react-bootstrap/Nav';
import './App.css'

function Navi() {
  return (
    <Nav className='Nav' defaultActiveKey="/home" as="ul">
      <Nav.Item >
      <Button variant="success">        <Nav.Link className='Link1' href="/home">Home</Nav.Link>
</Button>
      </Nav.Item>
    </Nav>
  );
}

export default Navi;
